
create extension if not exists "uuid-ossp";

drop table if exists vendor_6si, product_yin, vendor_product_info_dnm, car_eo0, vendor_car_info_n1q, razlichn_diag, models_and_prices cascade;

create table vendor_6si
(
    id      uuid primary key,
    name    text,
    phone   text
);

create table product_yin
(
    id              uuid primary key,
    model           text,
    category        text,
    brand           text,
    score           numeric,
    screen_material text,
    screen_size     int,
    height          int,
    width           int,
    weight          int,
    sales_start     int,
    sales_end       int,
    os              text,
    color           text
);

create table vendor_product_info_dnm
(
    vendor_id uuid references vendor_6si,
    product_id uuid references product_yin,
    price numeric,
    quantity int,
    primary key (product_id, vendor_id)
);

create table car_eo0
(
    id                uuid primary key,
    model             text,
    body_volume       int,
    lifting_capacity  int
);

create table vendor_car_info_n1q
(
    vendor_id uuid references vendor_6si,
    car_id uuid references car_eo0,
    quantity int,
    primary key (car_id, vendor_id)
);









select distinct model from product_yin join vendor_product_info_dnm vp on vp.product_id = product_yin.id
where (product_yin.color = 'белый' or product_yin.color = 'синий') and vp.price <= 20000 and vp.price >= 10000;





select name from vendor_6si join vendor_product_info_dnm vp on vp.vendor_id = vendor_6si.id join product_yin on vp.product_id = product_yin.id where category = 'смартфоны'
except 
select name from vendor_6si join vendor_product_info_dnm vp on vp.vendor_id = vendor_6si.id join product_yin on vp.product_id = product_yin.id where category = 'электронные книги';




select name from vendor_6si join vendor_product_info_dnm vp on vp.vendor_id = vendor_6si.id join product_yin on vp.product_id = product_yin.id where category = 'ноутбуки'
intersect 
select name from vendor_6si join vendor_product_info_dnm vp on vp.vendor_id = vendor_6si.id join product_yin on vp.product_id = product_yin.id where category = 'мониторы';




select name from vendor_6si join vendor_product_info_dnm vp on vp.vendor_id = vendor_6si.id join product_yin on vp.product_id = product_yin.id where category = 'часы'
union 
select name from vendor_6si join vendor_car_info_n1q vc on vc.vendor_id = vendor_6si.id join car_eo0 on vc.car_id = car_eo0.id where lifting_capacity >= 5 and lifting_capacity <= 10;




select sum(price) from vendor_product_info_dnm join product_yin on product_yin.id = vendor_product_info_dnm.product_id where category = 'ноутбуки';




with models_and_prices as
(select model, price from vendor_product_info_dnm join product_yin on product_yin.id = vendor_product_info_dnm.product_id where category = 'ноутбуки')

select distinct model from models_and_prices where price = (select min(price) from models_and_prices);




with different_diag as
(select distinct screen_size from product_yin where category = 'часы')

select count(screen_size) from different_diag;











